    background-color: black;
    height: 60px;
    padding: 10px;
    color: white;
    `,
    button: css` 
    position: absolute;
    border-radius: 5px;
    top: 85%;
    padding: 14px 28px;
    cursor: pointer;
    &:hover {
    color: white;
     background-color: black;
    transition: 1s;
     border-color:#DDDDDD;
    }&:focus {
        outline: none;
         background-color: black;
        color: white;

    }
    `,
}
